    if(FavS==='Netflix'){
        return <Netflix/>
}else{
    return <Amazon/>
    
};

}



const App=()=>(
    <>
    <h1 className="heading_style">Top 5 netflix series</h1>
   <favseries/>
    </>
);

export default App;
